    <style>
        #page-wrapper {
            position: absolute;
            left: 0;
            right: 0;
            bottom: 0;
            top: 0;
            background-color: #f1f3f6;
        }

        #menu {
            position: absolute;
            left: 5px;
            right: 5px;
            top: 5px;
            height: 35px;
        }

        #main {
            position: absolute;
            left: 5px;
            right: 5px;
            bottom: 5px;
            top: 45px;
            border: 1px #aaa solid;
            background-color: #fff;
        }

        #summary {
            background-color: #f9f9f9;
        } 
        
        .modal .btn-group.seriers {
            margin-bottom: 10px;
            margin-right: 10px;
        }

        .modal .panel select {
            width: initial
        }

        .splitter_panel {
            position: relative;
        }

        .splitter_panel .vsplitter {
            background-color: grey;
            cursor: col-resize;
            z-index: 900;
            width: 7px;
        }

        .splitter_panel .hsplitter {
            background-color: #f1f3f6;
            border-top: 1px #aaa solid;
            border-bottom: 1px #aaa solid;
            cursor: ns-resize;
            z-index: 800;
            height: 6px;
        }

        .splitter_panel .vsplitter.splitter-invisible,
        .splitter_panel .hsplitter.splitter-invisible {
            background: none;
        }

        .splitter_panel .vsplitter, .splitter_panel .left_panel, .splitter_panel .right_panel,
        .splitter_panel .hsplitter, .splitter_panel .top_panel, .splitter_panel .bottom_panel {
            position: absolute;
            overflow: auto;
        }

        .splitter_panel .vsplitter, .splitter_panel .left_panel, .splitter_panel .right_panel {
            height: 100%;
        }

        .splitter_panel .hsplitter, .splitter_panel .top_panel, .splitter_panel .bottom_panel {
            width: 100%;
        }

        .splitter_panel .top_panel, .splitter_panel .left_panel, .splitter_panel .vsplitter {
            top: 0;
        }

        .splitter_panel .top_panel, .splitter_panel .bottom_panel, .splitter_panel .left_panel, .splitter_panel .hsplitter {
            left: 0;
        }

        .splitter_panel .bottom_panel {
            bottom: 0;
        }

        .splitter_panel .right_panel {
            right: 0;
        }

        .splitterMask {
            position: absolute;
            left: 0;
            top: 0;
            right: 0;
            bottom: 0;
            z-index: 1000;
        }
    </style>
</head>

            app.chartBuilder = {
                elBody: '#custom-chart-modal .modal-body',
                elPanels: '#custom-chart-modal .modal-body .panels-wrapper',
                availableSeries: [],

                init: function(series) {
                    this.availableSeries = series;
                    var self = this;
                    // add panel click
                    $(this.elBody).find('.add-panel').click(function() {
                        self.addEmptyPanel();
                    });
                },

                addPanelWithSeriesList: function(series) {
                    var panel = this.addEmptyPanel();
                    var self = this;
                    $(series).each(function(i, item) {
                        self.addSingleSeriesToPanel(panel, item);
                    });
                },

                addEmptyPanel: function() {
                    var self = this;
                    var panelEl = $('<div class="panel panel-default"><div class="panel-heading clearfix">Plot Panel <a class="btn btn-default btn-xs pull-right remove-panel">x</a></div><div class="panel-body"></div></div>');
                    var select = $('<select class="form-control"><option>Add Series</option></select>');
                    var seriesWrapper = $('<div class="series-wrapper"></div>');
                    $(panelEl).find('.panel-body').append(seriesWrapper).append(select);
                    $(this.elPanels).append(panelEl);

                    // add series on select
                    select.change(function() {
                        var selected = $(this).find('option:selected');
                        var series = selected.data('series');
                        if (series) {
                            self.addSingleSeriesToPanel(panelEl, series);
                        }
                    });

                    // add all series options
                    $(this.availableSeries).each(function(i, item) {
                        var op = $('<option></option>');
                        op.text(item.name);
                        op.data('series', item);
                        $(select).append(op);
                    });

                    // remove panel click
                    panelEl.find('.remove-panel').click(function() {
                        panelEl.remove();
                    });

                    return panelEl;
                },

                addSingleSeriesToPanel: function(panel, series) {
                    // add new series element to panel
                    var g = $('<div class="btn-group seriers"></div>');
                    var label = $('<button type="button" class="btn btn-info">' + series.name + '</button>');
                    var remove = $('<button type="button" class="btn btn-warning">X</button>');
                    g.append(label).append(remove);
                    panel.find('.series-wrapper').append(g);

                    // attached series to item for later user
                    g.data('series', series);

                    // add remove handler
                    remove.click(function() {
                        $(this).parent().remove();
                    });
                },

                getData: function() {
                    var data = [];
                    $(this.elPanels).find('.panel').each(function() {
                        var panel = { series: [] };
                        $(this).find('.series-wrapper .seriers').each(function() {
                            panel.series.push($(this).data('series'));
                        });
                        data.push(panel);
                    });
                    return data;
                },

                setStrategyEquityChart: function() {
                    this.clear();
                    for (var i = 0; i < this.availableSeries.length; i++) {
                        if (this.availableSeries[i].name == 'Equity') {
                            this.addPanelWithSeriesList([this.availableSeries[i]]);
                        }
                        if (this.availableSeries[i].name == 'Daily Performance') {
							var d = this.availableSeries[i]
							console.log('d', d);
							for(var j = 0; j < d.data.length; j++){
								console.log(moment.utc(d.data[j][0]))
							}
                            this.addPanelWithSeriesList([d]);
                        }
                    };
                },

                clear: function() {
                    $(this.elPanels).empty();
                }
            }
        })(app);

        (function (app) {
            app.helpers = {
                getSeriesFromQuantConnectCahrts: function() {
                    return $.map(_data.Charts, function(chart) {
                        return $.map(chart.Series, function(s) {
                            var track = {
                                name: s.Name,
                                type: app.helpers.getSeriesType(s.SeriesType),
                                symbol: 'none'
                            };
                            track.data = [];
                            $.each(s.Values, function(k, item) {
                                var time;
                                if (isNaN(item.x)) {
                                    time = moment(item.x).toDate();
                                } else {
                                    time = new Date(item.x * 1000);
                                }
                                track.data.push([time, item.y]);
                            });
                            return track;
                        });
                    });
                },

                getSeriesFromQuantConnectOrders: function() {
                    var ordersSeries = {};
                    $.each(_data['Orders'], function(k, v) {
                        var key = v.Symbol.Value + '_' + app.helpers.getOrderDirection(v.Direction);
                        var series = ordersSeries[key];
                        if (!series) {
                            series = {
                                name: key,
                                type: 'scatter',
                                data: []
                            }
                            series.symbol = 'triangle';
                            series.symbolSize = 6;
                            if (v.Direction == 1)
                                series.symbolRotate = 180;
                            ordersSeries[key] = series;
                        }

                        var time = v.Time;
                        if (time.indexOf('Z') == -1)
                            time += 'Z';
                        series.data.push([
                            moment(time).toDate(),
                            v.Price
                        ]);
                    });
                    var series = [];
                    $.each(ordersSeries, function(k, v) {
                        series.push(v);
                    });
                    return series;
                },

                getDefaultEchartOptions: function() {
                    return {
                        tooltip: {
                            trigger: 'axis',
                            showContent: false,
                            axisPointer: {
                                type: 'cross'
                            },
                            transitionDuration: 0,
                            showDelay: 0,
                            formatter: null
                        },
                        toolbox: {
                            show: true,
                            y: 15,
                            feature: {
                                mark: {
                                    show: true,

                                        mark: 'Mark',
                                        markUndo: 'Undo',
                                        markClear: 'Clear'
                                    }
                                },
                                //magicType: { show: true, type: ['line', 'bar'] },
                                restore: {
                                    show: true,
                                    title: 'Reset'
                                },
                                dataZoom: {
                                    show: true,
                                    title: {
                                        dataZoom: 'Zoom',
                                        dataZoomReset: 'Reset Zoom'
                                    }
                                }
                            }
                        },
                        legend: {
                          y: 15  
                        },
                        xAxis: [
                            {
                                type: 'time',
                                splitNumber: 10
                            }
                        ],
                        yAxis: [
                            {
                                type: 'value',
                                scale: true
                            }
                        ],
                        grid: {
                            y: 60
                        }
                    };
                },

                getSeriesType: function(id) {
                    switch (id) {
                    case 0:
                        return 'line';
                    case 1:
                        return 'scatter';
                    case 2:
                        return 'line';
                    case 3:
                        return 'bar';
                    default:
                        return 'line';

                getOrderType: function(id) {
                    switch (id) {

                        return 'StopLimit';
                    case 4:

                        return 'MarketOnClose';

                getOrderDirection: function(id) {

        (function (app) {
            app.echart = {};
            app.echart.helpers = {
                hackEchartToFixedDisplayIssues: function (echart) {
                    // hack this function to modify echart to display date correctly in cross mode
                    var originalFuc = echart.component.tooltip._styleAxisPointer;
                    echart.component.tooltip._styleAxisPointer = function (seriesArray, xStart, yStart, xEnd, yEnd, gap, x, y) {
                        var self = echart.component.tooltip;
                        originalFuc.apply(self, arguments);

                        // calc y calue
                        var yAxis = this.component.yAxis.getAxis(0);
                        var coord = y;
                        coord = coord < yAxis.grid.getY() ? yAxis.grid.getY() : coord;
                        coord = coord > yAxis.grid.getYend() ? yAxis.grid.getYend() : coord;
                        var yVal = (yAxis._max - (coord - yAxis.grid.getY()) / yAxis.grid.getHeight() * (yAxis._max - yAxis._min));

                        // adjust decimal point base on max min diff
                        if ((yAxis._max - yAxis._min) < 5) {
                            yVal = yVal.toFixed(4) - 0;
                        } else {
                            yVal = yVal.toFixed(2) - 0;
                        }

                        // override text to changed display value
                        self._axisCrossShape.style.text = ('( '
                                + moment((this.component.xAxis.getAxis(0).getValueFromCoord(x))).format('YYYY-MM-DD HH:mm:ss')
                                + ' , '
                                + yVal
                                + ' )'
                        ).replace('  , ', ' ').replace(' ,  ', ' ');
                    };
                }
            };
        })(app);

        (function(app) {
            app.chartRender = {
                plots: [],

                render: function() {
                    var self = this;

                    // get all plots from chart builder
                    this.plots = app.chartBuilder.getData();

                    // create an inner div to hold all plots
                    var divToSplit = $('<div style="width:100%; height:100%;"></div>');
                    $('#chart-wrapper').empty().append(divToSplit);

                    // get number of splits
                    var splits = this.plots.length - 1;
                    console.log('plits: ', splits);

                    if (splits > 0) {
                        var counter = 0;
                        for (var i = 0; i < splits; i++) {
                            var div1 = $('<div></div>');
                            var div2 = $('<div></div>');
                            divToSplit.append(div1);
                            divToSplit.append(div2);
                            $(divToSplit).split({
                                orientation: 'horizontal',
                                limit: 20,
                                position: (100 / (splits + 1 - i)) + '%',
                                onDrag: function() {
                                    self.resizeAllPlots();
                                }
                            });
                            this.plots[counter++].div = div1;
                            if (i == splits - 1) {
                                console.log('counter:', counter);
                                this.plots[counter].div = div2;
                            }
                            divToSplit = div2;
                        }
                    }

                    //only one plot no need to split 
                    if (splits == 0) {
                        this.plots[0].div = divToSplit;
                    }

                    // find time min and max
                    var timeMax = moment('1000-01-01');
                    var timeMin = moment('9999-01-01');
                    for (var i = 0; i < this.plots.length; i++) {
                        var plot = this.plots[i];
                        for (var j = 0; j < plot.series.length; j++) {
                            var sdata = plot.series[j].data;
							if(moment(sdata[0][0]).isBefore(timeMin))
								timeMin = sdata[0][0];
							if(moment(sdata[sdata.length-1][0]).isAfter(timeMax))
								timeMax = sdata[sdata.length-1][0];
                        }
                    }
					var totalTimeMiilis = moment(timeMax).diff(timeMin);
					console.log('time diff', totalTimeMiilis);

                    // create the echarts
                    for (var i = 0; i < this.plots.length; i++) {
                        var plot = this.plots[i];

                        // get plot echart option
                        var option = app.helpers.getDefaultEchartOptions();
                        option.series = plot.series;

                        // set legend 
                        option.legend.data = $.map(option.series, function(item) {
                            return item.name;
                        });
						
						console.log('min', timeMin);
						console.log('max', timeMax);
						console.log('xAxis', option.xAxis); 
						// set xAxis 
						option.xAxis[0].min =  timeMin;
						option.xAxis[0].max =  timeMax;
						option.xAxis[0].scale = true;
						
						
						console.log('optoin', option);

                        // config tooltip in needed
                        option.tooltip.showContent = true;
                        option.tooltip.transitionDuration = 0.4;
                        option.tooltip.formatter = function(params) {
                            return moment(params.data[0]).format('YYYY-MM-DD HH:mm:ss') + '<br/>'
                                + params.data[1];
                        }

                        // if first add zoom tool
                        if (i == 0) {
                            option.dataZoom = {
                                show: true,
                                realtime: false,
                                y: 15
                            };
                            option.grid.y = 90;
                            option.legend.y = 60;
                            option.toolbox.y = 60;
                        }

                        // create the echart
                        plot.echart = echarts.init(plot.div.get(0));
                        plot.echart.setOption(option);
                        app.echart.helpers.hackEchartToFixedDisplayIssues(plot.echart);
						
						console.log('xxx', plot.echart.component);
						plot.echart.component.dataZoom.syncOption = function(){
							console.log('sync option');
						};
						
						var self = this;
						plot.echart.on(echarts.config.EVENT.DATA_ZOOM, function(param, echart){	
							console.log('DATA_ZOOM', param);
							console.log('echar', echart);
			
							var zoomStart = param.zoom.start;
							var zoomEnd = param.zoom.end;
							
							var newMin = moment(timeMin).add(totalTimeMiilis * (zoomStart / 100), 'ms');
							var newMax = moment(timeMin).add(totalTimeMiilis * (zoomEnd / 100), 'ms');
							console.log('new min', newMin.format());
							
							for (var k = 0; k < self.plots.length; k++) {
								self.plots[k].echart.setOption({
									xAxis: [{
											min: newMin.toDate(),
											max: newMax.toDate()
									}]
								});
							}
						});
						
						
						plot.echart.on(echarts.config.EVENT.REFRESH, function(param){
							console.log('REFRESH', param);
						})
						
                    }

                    // connect all charts
                    for (var i = 0; i < this.plots.length; i++) {
                        var others = [];
                        for (var j = 0; j < this.plots.length; j++) {
                            if (i != j) {
                                others.push(this.plots[j].echart);
                            }
                        }
                        if (others.length > 0) {
                            this.plots[i].echart.connect(others);
                        }
                    }

                },

                resizeAllPlots: function() {
                    for (var i = 0; i < this.plots.length; i++) {
                        this.plots[i].echart.resize();
                    }
                }
            };
        })(app);

        //------------------------------------------------------------------
        // Splitter plugin
        // Origin: https://github.com/jcubic/jquery.splitter
        //------------------------------------------------------------------
        (function ($, undefined) {
            var count = 0;
            var splitter_id = null;
            var splitters = [];
            var current_splitter = null;
            $.fn.split = function (options) {
                var data = this.data('splitter');
                if (data) {
                    return data;
                }
                var panel_1;
                var panel_2;
                var settings = $.extend({
                    limit: 100,
                    orientation: 'horizontal',
                    position: '50%',
                    invisible: false,
                    onDragStart: $.noop,
                    onDragEnd: $.noop,
                    onDrag: $.noop
                }, options || {});
                this.settings = settings;
                var cls;
                var children = this.children();
                if (settings.orientation == 'vertical') {
                    panel_1 = children.first().addClass('left_panel');
                    panel_2 = panel_1.next().addClass('right_panel');
                    cls = 'vsplitter';
                } else if (settings.orientation == 'horizontal') {
                    panel_1 = children.first().addClass('top_panel')
                    panel_2 = panel_1.next().addClass('bottom_panel');
                    cls = 'hsplitter';
                }
                if (settings.invisible) {
                    cls += ' splitter-invisible';
                }
                var width = this.width();
                var height = this.height();
                var id = count++;
                this.addClass('splitter_panel');
                var splitter = $('<div/>').addClass(cls).bind('mouseenter touchstart', function () {
                    splitter_id = id;
                }).bind('mouseleave touchend', function () {
                    splitter_id = null;
                }).insertAfter(panel_1);
                var position;

                function get_position(position) {
                    if (typeof position === 'number') {
                        return position;
                    } else if (typeof position === 'string') {
                        var match = position.match(/^([0-9\.]+)(px|%)$/);
                        if (match) {
                            if (match[2] == 'px') {
                                return +match[1];
                            } else {
                                if (settings.orientation == 'vertical') {
                                    return (width * +match[1]) / 100;
                                } else if (settings.orientation == 'horizontal') {
                                    return (height * +match[1]) / 100;
                                }
                            }
                        } else {
                            //throw position + ' is invalid value';
                        }
                    } else {
                        //throw 'position have invalid type';
                    }
                }

                var self = $.extend(this, {
                    refresh: function () {
                        var new_width = this.width();
                        var new_height = this.height();
                        if (width != new_width || height != new_height) {
                            width = this.width();
                            height = this.height();
                            self.position(position);
                        }
                    },
                    position: (function () {
                        if (settings.orientation == 'vertical') {
                            return function (n, silent) {
                                if (n === undefined) {
                                    return position;
                                } else {
                                    position = get_position(n);
                                    var sw = splitter.width();
                                    var sw2 = sw / 2;
                                    if (settings.invisible) {
                                        var pw = panel_1.width(position).outerWidth();
                                        panel_2.width(self.width() - pw);
                                        splitter.css('left', pw - sw2);
                                    } else {
                                        var pw = panel_1.width(position - sw2).outerWidth();
                                        panel_2.width(self.width() - pw - sw);
                                        splitter.css('left', pw);
                                    }
                                }
                                if (!silent) {
                                    self.find('.splitter_panel').trigger('splitter.resize');
                                }
                                return self;
                            };
                        } else if (settings.orientation == 'horizontal') {
                            return function (n, silent) {
                                if (n === undefined) {
                                    return position;
                                } else {
                                    position = get_position(n);
                                    var sw = splitter.height();
                                    var sw2 = sw / 2;
                                    if (settings.invisible) {
                                        var pw = panel_1.height(position).outerHeight();
                                        panel_2.height(self.height() - pw);
                                        splitter.css('top', pw - sw2);
                                    } else {
                                        var pw = panel_1.height(position - sw2).outerHeight();
                                        panel_2.height(self.height() - pw - sw);
                                        splitter.css('top', pw);
                                    }
                                }
                                if (!silent) {
                                    self.find('.splitter_panel').trigger('splitter.resize');
                                }
                                return self;
                            };
                        } else {

                        }
                    })(),
                    orientation: settings.orientation,
                    limit: settings.limit,
                    isActive: function () {

                    },
                    destroy: function () {
                        self.removeClass('splitter_panel');

                        splitter.unbind('mouseleave');
                        splitter.unbind('touchstart');
                        splitter.unbind('touchmove');
                        splitter.unbind('touchend');
                        splitter.unbind('touchleave');
                        splitter.unbind('touchcancel');
                        if (settings.orientation == 'vertical') {
                            panel_1.removeClass('left_panel');
                            panel_2.removeClass('right_panel');
                        } else if (settings.orientation == 'horizontal') {
                            panel_1.removeClass('top_panel');
                            panel_2.removeClass('bottom_panel');
                        }
                        self.unbind('splitter.resize');
                        self.find('.splitter_panel').trigger('splitter.resize');
                        splitters.splice(id, 1);
                        count--;
                        splitter.remove();
                        var not_null = false;
                        for (var i = splitters.length; i--;) {
                            if (splitters[i] !== null) {
                                not_null = true;
                                break;
                            }
                        }
                        //remove document events when no splitters
                        if (!not_null) {
                            $(document.documentElement).unbind('.splitter');

                        pos > self.width()) {

                    } else if (self.orientation == 'horizontal' &&
                               pos > self.height()) {
                        pos = self.height() - self.limit - 1;
                    }
                    if (pos < self.limit) {
                        pos = self.limit + 1;
                    }
                    self.position(pos, true);

                //inital position of splitter

                    if (pos > height - settings.limit) {
                        pos = height - settings.limit;

                        pos = get_position(settings.position);

                            current_splitter.settings.onDragStart(e);

                            var limit = current_splitter.limit;
                            var offset = current_splitter.offset();
                            if (current_splitter.orientation == 'vertical') {
                                var pageX = e.pageX;
                                if (e.originalEvent && e.originalEvent.changedTouches) {
                                    pageX = e.originalEvent.changedTouches[0].pageX;
                                }
                                var x = pageX - offset.left;
                                if (x <= current_splitter.limit) {
                                    x = current_splitter.limit + 1;
                                } else if (x >= current_splitter.width() - limit) {
                                    x = current_splitter.width() - limit - 1;
                                }
                                if (x > current_splitter.limit &&
                                    x < current_splitter.width() - limit) {
                                    current_splitter.position(x, true);
                                    current_splitter.find('.splitter_panel').
                                        trigger('splitter.resize');
                                    e.preventDefault();
                                }
                            } else if (current_splitter.orientation == 'horizontal') {
                                var pageY = e.pageY;
                                if (e.originalEvent && e.originalEvent.changedTouches) {
                                    pageY = e.originalEvent.changedTouches[0].pageY;
                                }
                                var y = pageY - offset.top;
                                if (y <= current_splitter.limit) {
                                    y = current_splitter.limit + 1;
                                } else if (y >= current_splitter.height() - limit) {
                                    y = current_splitter.height() - limit - 1;
                                }
                                if (y > current_splitter.limit &&
                                    y < current_splitter.height() - limit) {
                                    current_splitter.position(y, true);
                                    current_splitter.find('.splitter_panel').
                                        trigger('splitter.resize');
                                    e.preventDefault();
                                }
                            }
                            current_splitter.settings.onDrag(e);
                        }
                    });
                }
                splitters.push(self);
                self.data('splitter', self);
                return self;
            };
        })(jQuery);
